#include <string>
#include <vector>
#include <cmath>
using namespace std;

class Solution {
public:
    int minimumBeautifulSubstrings(string s) {
        vector<long long> powersOf5;
        long long power = 1;
        while (power < (1LL << s.size())) {
            powersOf5.push_back(power);
            power *= 5;
        }

        vector<int> dp(s.size() + 1, 1e9);
        dp[0] = 0; // Base case: no substrings for an empty string

        for (int i = 1; i <= s.size(); ++i) {
            if (s[i - 1] == '0') continue; // Skip leading zeros
            long long num = 0;
            for (int j = i; j >= 1; --j) {
                num = num >> 1 | (s[j - 1] - '0') << (i - j);
                if (find(powersOf5.begin(), powersOf5.end(), num) != powersOf5.end()) {
                    dp[i] = min(dp[i], dp[j - 1] + 1);
                }
            }
        }

        return dp[s.size()] >= 1e9 ? -1 : dp[s.size()];
    }
};
